シャオミ Xiaomi ピストン２  piston2 イヤフォン 高音質 カナル型  スマホ イヤフォンジャック 音楽今、話題のシャオミの高音質イヤホンフォンです。<BR><BR>
広い音場、豊かな低域、伸びやかな中高域と安価なイヤホンとは思えないサウンドクオリティを実現しています。<BR>
ベリリウム性の振動板を使用しているため、バランスに優れた音響特性が期待されます。<BR>
リモートコントロール機能、マイクロフォン機能がついています。<BR>
※主流のアンドロイド携帯電話に対応しております。<BR>
アイフォンでは、リモコンのボリューム上下のみ非対応。再生、停止は可能。<BR><BR>

タイプ：インイヤー型<BR><BR>
カラー：ゴールド・シルバー<BR><BR>
重量：１２グラム<BR><BR>
